import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css"
import NavBar from './NavBar';

ReactDOM.render(
  <React.StrictMode>
      <NavBar/>
    <App />


  </React.StrictMode>,
  document.getElementById('root')
);

